fibs = 0 : 1 : zipWith (+) fibs (tail fibs)
firstThreeHundredThousandDigitFibIndex (x:xs) index = if x > 10^299999 then index else firstThreeHundredThousandDigitFibIndex xs (index+1)
firstThreeHundredThousandDigitFib = head $ dropWhile (<10^299999) fibs
sumDigits x acc = acc `seq` if x < 10 then x+acc else sumDigits (x `div` 10) (acc + (x `rem` 10))
main = print $ sumDigits firstThreeHundredThousandDigitFib 0

